import React from 'react'
interface TVShowsPro {
  name: string;
  imgUrl: string;
  showDate: string;
  rating: number;
  isAvailable: boolean;
}

const tvShows :TVShowsPro[]=[
  {
      name:'Breaking Bad',
      imgUrl:'data:image/jpeg;base64,',
      showDate:'2008–2013',
      rating:9,
      isAvailable:true
  },
  {
      name:'Game of Thrones',
      imgUrl:'data:image/jpeg;base64,',
      showDate:'2011–2019',
      rating:9,
      isAvailable:true
  },
  {
      name:'Planet Earth II',
      imgUrl:'data:image/jpeg;base64,',
      showDate:'2016',
      rating:8,
      isAvailable:true
  },
  {
      name:'The Wire',
      imgUrl:'data:image/jpeg;base64,',
      showDate:'2010',
      rating:8.7,
      isAvailable:true
  },
  {
      name:'Friends',
      imgUrl:'data:image/jpeg;base64,',
      showDate:'1994',
      rating:8.5,
      isAvailable:false
  }
  


]
function TVShows() {
  return (
    <>
    {tvShows.map((movie, i) => {
      let soonMsg: string = '';
      if (!movie.isAvailable) {
        soonMsg = 'Soory will be available soon';
      }
      return (
        <div key={i} className="card">
          <img className="card-img" src={movie.imgUrl} alt="" />
          <h2>{movie.name}</h2>
          <p id='p'>{movie.showDate}</p>
          <p>{movie.rating}⭐</p>
          <p>{movie.isAvailable}</p>
          {soonMsg.length > 0 ? <p>{soonMsg}</p> : <span></span>}
        </div>
      );
    })}
  </>
  )
}

export default TVShows